	<form>
		<fieldset>
		<table align="center" cellspacing="5" cellpadding="5px">
			<caption>
				<h1 align="center">
				COVID-19 Vaccine Registration Form
			</h1>
			</caption>
			<tr>
				<td>
					First Name
				</td>
				<td>
					<input type="text" name="First Name">
				</td>
			</tr>
			<tr>
				<td>
					Last Name
				</td>
				<td>
					<input type="text" name="Last Name">
				</td>
			</tr>
			<tr>
				<td>
					Aadher No
				</td>
				<td>
					<input type="text" pattern="[0-9]{12}">
				</td>
			</tr>
			<tr>
				<td>
					Vaccine Name
				</td>
					<td>
					<select>
						<option disabled selected> Please Select Vaccine Name </option>
						<option> V1 </option>
						<option> V2 </option>
						<option> V3 </option>
					</select>
				</td>
			</tr>
			<tr>
				<td>
					Vaccination Center Name
				</td>
				<td>
					<select>
						<option disabled selected> Please Select Vaccination Center  </option>
						<option> Rajkot</option>
						<option> Morbi</option>
						<option> Jamnagar</option>
						<option> Gondal</option>
					</select>
				</td>
			</tr>
			<tr>
				<td>
					Date Of Dose
				</td>
				<td>
					<input type="date">
				</td>
			</tr>
			<tr>
				<td>
				Does Number
				</td>
				<td>
					<input type="number" max="3" min="1">
				</td>
			</tr>
			<tr align="center">
				<td colspan="2">
				<button type="submit"> CLICK HERE </button>
				<button> Cancel </button>
				</td>
			</tr>
		</fieldset>
	</form>
